    return (
        <Grid container spacing={2} sx={{ flexGrow: 1 }}>
            <Grid size={8}>
                <h1>size=8</h1>
            </Grid>
            <Grid size={4}>
                <h1>size=4</h1>
            </Grid>
            <Grid size={4}>
                <h1>size=4</h1>
            </Grid>
            <Grid size={8}>
                <h1>size=8</h1>
            </Grid>
        </Grid>
    )
}
export default Content;
